import SignInPage from "../SignIn";

const HomePage = () => (
    <div>
        <h1>Home Page</h1>
        <p>The Home Page is accessible by every signed in user.</p>
    </div>
);

class HomePageBase extends Component {

}

const Home = compose(
    withRouter,
    withFirebase,
)(HomePageBase);

const condition = authUser => !!authUser;

export default HomePage;

export { Home };
